import React from 'react';
import PropTypes from 'prop-types';
import styles from './CSS Modules/header-style.module.css';
const Header = ({ title }) => {

    return (
        <header className={styles.headerblue}>
        <h1 className={styles.headerText}>{title}</h1>
        </header>
    )
}
Header.defaultProps = {
    title: 'Log Your Music.',
}

Header.propTypes = {
title: PropTypes.string.isRequired,
}
export default Header
